/** @format */

import React from 'react';
import { Link } from 'react-router-dom';
import { MenuOutlined } from '@material-ui/icons';

const Header = () => {
	return (
		<div className='header'>
			<div className='menu-icon'>
				<MenuOutlined className='menu' />
			</div>

			<nav>
				<ul>
					<li>
						<Link to='/'></Link>
					</li>
				</ul>
			</nav>
		</div>
	);
};

export default Header;
